import React, { Component } from 'react';
import Link from 'next/link';
import Input from '../input/index';

export default class Login extends Component {

    state = {
        login: {username: "", password: ""}
    };

        handleLoginSubmit= e =>{
                e.preventDefault();
                    //Call to Server
                console.log("Login Form Submitted");
        }; 

        handleSignUp = () => {
            console.log("First Name: " + this.state.signUp.firstName);
            console.log("Last Name: " + this.state.signUp.lastName);
            console.log("Email: " + this.state.signUp.email);
            console.log("Password: " + this.state.signUp.password);
            console.log("Confirm Password: " + this.state.signUp.confirmPassword);
         };

    render() {
            const {login} = this.state;
            return (
                <React.Fragment>
                    <div className="container">
                        <h1 className="text-center">
                            Login Page...
                        </h1>

                        <form onSubmit={this.handleLoginSubmit}>

                            <Input
                                name="username"
                                value={login.username}
                                label="Email Address"
                                onChange={this.handleChange}
                            />
                            <Input
                                name="password"
                                value={login.password}
                                label="Password"
                                onChange={this.handleChange}
                            />

                            <Link href="/home">
                                <button type="submit" className="btn btn-primary">Submit</button>
                            </Link>
                            <button type="submit" className="btn btn-primary" onClick={this.handlelogin}>
                                Submit For Data
                            </button>
                            <Link href="/signup">
                                <button type="submit" className="btn btn-primary">Not A Member</button>           
                            </Link>
                            <Link href="/forgot-password">
                                <button type="submit" className="btn btn-primary">Forgot Password</button>
                            </Link>
                        </form>
                    </div>
                </React.Fragment>
            )
        }
}

















